import React from 'react'


export default function Question(props) {
  return (
   <>
    
    <h1>{ props.qno} {props.quest}</h1>


        <input type='radio' name={props.qno} value='A' /> {props.optA}
        <br></br>
        <input type='radio' name={props.qno} value='B' /> {props.optB}
        <br></br>
        <input type='radio' name={props.qno} value='C' /> {props.optC}
        
        <br></br>
        <input type='radio' name={props.qno} value='D' /> {props.optD}
        

        
   </>
  )
}
